  false,\n\t\"url\": null,\n\t\"notes\": \"Drs. Marla Holt, Brad Hanson, and Candice
  Emmons of the NWFSC, along with efforts from the NWFSC dive team (coordinated by
  Nick Tolimieri), are currently conducting passive acoustic monitoring of harbor
  porpoises in Puget Sound. The occurrence of harbor porpoises are being acoustically
  documented using porpoise detectors (CPODs, made by  Chelonia, Ltd), which detect
  and log harbor porpoise echolocation clicks and store the data on flash memory cards.
  CPODs are deployed on the sea floor by scientific divers, and must be recovered
  every three months to replace batteries and memory cards. The project is ongoing,
  and will document occurrence and habitat use of this protected marine species. The
  project is a well-defined component of a larger study that addresses harbor porpoise
  occurrence and habitat use in the Salish Sea.nnPassive acoustic monitoring.\",\n\t\"owner_org\":
